import React from 'react';
import {useDispatch} from "react-redux";
import {TabsPagesActionType} from "../../types/typeTabsPages";
import {Nav} from "react-bootstrap";


const AccountNavBar = () => {
    const dispatch = useDispatch();
    const Data = () => {dispatch({
        type: TabsPagesActionType.FLIP_BOOKMARK_ACCOUNT,
        payload: {data: true, order: false, historyOrder: false}
    })}
    const Order = () => {dispatch({
        type: TabsPagesActionType.FLIP_BOOKMARK_ACCOUNT,
        payload: {data: false, order: true, historyOrder: false}
    })}
    const HistoryOrder = () => {dispatch({
        type: TabsPagesActionType.FLIP_BOOKMARK_ACCOUNT,
        payload: {data: false, order: false, historyOrder: true}
    })}

    return (
            <div style={{display: "flex", justifyContent: "center"}}>
                <Nav variant={""}>
                    <Nav.Item>
                        <Nav.Link onClick={Data} style={{position: "relative", background: "white"}}>
                            <span style={{color: "blue"}}>Особисті дані</span>
                        </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link type={"button"} onClick={Order} style={{position: "relative", background: "white"}}>
                            <span style={{color: "blue"}}>Поточне замовлення</span>
                        </Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link type={"button"} onClick={HistoryOrder} style={{position: "relative", background: "white"}}>
                            <span style={{color: "blue"}}>Історія замовлень</span>
                        </Nav.Link>
                    </Nav.Item>
                </Nav>
            </div>
    );
};

export default AccountNavBar;
